    <script>
        function getName(id, item){
            //document.querySelectorAll('.azMap').classList.remove('pathActive');
            document.querySelector('#'+id).classList.add('pathActive');
            var countyName = document.querySelector('#'+id).getAttribute('data-county');
            resetMap(item);

            alert("County Name: " + countyName);
        }

        function resetMap(item){
            var totalCounty = 15;
            for( i=1 ; i<=totalCounty ; i++){
                if( item != i ){
                    if( i<10 ){
                        document.querySelector('#map0'+i).classList.remove('pathActive');
                    } else {
                        document.querySelector('#map'+i).classList.remove('pathActive');
                    }
                }
            }   
        }
    </script>
